import './Bootstrap.css'
import './App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom"
import Home from './components/Home'
import NavBar from './components/NavBar'
import Header from './components/Header'
import TodoForm from './components/TodoForm'
import TodoContainer from './containers/ExisitingTodo';

  function App() {
    return(
      <div className="App">
      <Router>
      <NavBar/>
      &nbsp;
      &nbsp;
      <Header slogan="Let's get to work!"/>
      <Switch>
        <Route path="/">
            <Home />
        </Route>
        <Route path="/TodoForm">
            <TodoForm />
        </Route>
        {/* <Route path="/ExistingTodoContainer">
            <ExisitingTodoContainer />
        </Route> */}
      </Switch>
    </Router>
    </div>
  );
  }
export default App
